import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the login form to be visible
    await page.waitForSelector('#email');
    await page.waitForSelector('#password');

    // Fill in the login form
    await page.fill('#email', 'your_email@example.com');
    await page.fill('#password', 'your_password');

    // Click the login button
    await page.click('button.login-btn');
    await page.waitForLoadState('networkidle');

    // Take a screenshot after login attempt
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_login.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_login.png'));

    // Verify if login was successful by checking for a specific element on the home page
    const isLoggedIn = await page.isVisible('selector_for_logged_in_element'); // Replace with actual selector
    if (isLoggedIn) {
      return {
        success: true,
        action: "Successfully logged in and verified the home page.",
        extractedData: {
          message: "Login successful"
        },
        screenshots,
        error: null
      };
    } else {
      return {
        success: false,
        action: "Login failed, home page element not found.",
        extractedData: {},
        screenshots,
        error: "Login was not successful."
      };
    }
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

